l']=0,['EffectType']=8503,['Id']=1058,['MetaData']={['message']='Welcome to my inspiration house.  This house was built prior to precision editing being available and is my first to be built from the ground up. EHT Fx were added later.  \\n\\nIt isn\\'t perfect and took several months to create but I own every mistake and mis-alignment.  LOL\\n\\nIf you see an element that looks familiar, please take it as a compliment.\\n\\nThank you for visiting.\\n\\nP.S. When looking for treasure, always look under the \"Big W\". <wink><wink>(this is a movie reference)',['title']='Inspiration House',},['Color']=994191,['SizeY']=70,['Pitch']=6.195919,},},['TS']=1631566091,}"
