R["fx__na__@dara_shadowmane__80"]="{['Version']=1761,['TS']=1631559797,['Effects']={[1]={['SizeZ']=1000,['Id']=1145,['Contrast']=1,['Yaw']=0.385718,['Y']=19824,['EffectType']=29,['SizeX']=980,['Pitch']=0,['SizeY']=2,['Groups']=0,['Alpha']=0.440000,['Z']=107072.238820,['Color']=999998,['X']=104062.746598,['Roll']=0,},[2]={['SizeZ']=110,['Id']=1146,['Contrast']=2.750000,['Alpha']=1,['Y']=19587,['EffectType']=8501,['SizeX']=86.456456,['Pitch']=0,['Yaw']=5.120796,['SizeY']=110,['Groups']=0,['Z']=104798,['MetaData']={['message']='\"I crave adventure\", the royal scion of Skyrim, Prince Irnskar, bellowed.  \\nKing Jorunn the Skald-King, overhearing his son\\'s outburst replied, \"Good because I have a task for you\". \"I have received reports of outbreaks of sporadic fighting in a location in Western Skyrim and I am sending you to look into it.\"\\n\\n\"Here is your opportunity to exercise your diplomatic skills but bring this situation under control by whatever means necessary\", Jorunn continued.  \"My Emissary, Rigurt is nearby in case you need some assistance,\" the King added knowing full well the Prince\\'s feelings toward the Nord\\'s unconventional diplomacy.  \"Gather your gear, you will leave immediately,\" Jorunn continued, handing Irnskar a map with the destination marked.  Irnskar brushed away a tiny speck, which disappeared with an audible pop, as he took the map.\\n\\nDuring the journey, Prince Irnskar reflected upon his father.  \"Jorunn the Skald-King is the strongest man I\\'ve ever known.  I hope to someday be half the man he is and in time to carry on his legacy.\"  \"Sometimes I suspect I\\'ll never live up to his expectations.\"  Irnskar again brushed away a tiny speck  as he had in the previous days whenever he spoke of his father.  It disappeared with a pop.\\n\\nThe Prince reached Solitude well after dark on the 5th day.  Word had reached the Blue Palace ahead of his arrival and after days of travel and sleeping under the stars, the gates were a welcome sight.  Upon his arrival, he was presented an envelope upon a silver tray.  The Prince took it and read the contents.  ',['title']='Irnskar\\'s Folly  Pt. 1',},['Color']=102439,['X']=108283,['Roll']=0,},[3]={['SizeZ']=110,['Id']=1147,['Contrast']=2.580000,['Alpha']=1,['Y']=19587,['EffectType']=8501,['SizeX']=86.456456,['Pitch']=0,['Yaw']=5.134759,['SizeY']=110,['Groups']=0,['Z']=104940,['MetaData']={['message']='\"Your Highness, it began, please forgive my absence. I am away tending to matters in Markarth.  Your arrival is somewhat of a surprise nevertheless, I have instructed my staff to provide you with whatever you desire.  Please enjoy your stay, your servant Svanna.\" \\n\\nThe first spark of sunlight could be seen as the Prince readied his mount to depart from the Blue Palace the next morning.  The instructions from his father were clear, intervene as quickly as possible to quell any possible escalating conflict.\\n\\nAfter consulting with the Palace cartographer, Irnskar had a better understanding of the location he was to visit.  It was a remote area, accessible only by dwarven ruins set into the side of a mountain.  As a Nord he was uniquely suited for the frozen landscape he would need to traverse.  \\n\\nSeveral hours outside of Solitude, and to the East of Hordrek\\'s hunting grounds, Irnskar found himself face-to-face with a dwarven metal door.  He opened it and stepped through.',['title']='Irnskar\\'s Folly  Pt. 2',},['Color']=102439,['X']=108337,['Roll']=0,},[4]={['SizeZ']=110,['Id']=1148,['Contrast']=1,['Alpha']=1,['Y']=19608,['EffectType']=8503,['SizeX']=86.456456,['Pitch']=0,['Yaw']=5.134759,['SizeY']=110,['Groups']=0,['Z']=105310,['MetaData']={['message']='He was greeted by a lit but empty corridor leading to a seemingly empty \\nchamber containing a single but oddly familiar statue.  He continued through to a second metal door.  As he laid his hand upon the door, aether mists formed around him and he vanished with an audible pop.\\n\\n\"Believe me, I want to avoid the throne for as many years as I can.\"  The statement echoed in Irnskar\\'s ears as he materialized in what appeared to be a pocket realm of Oblivion.\\n\\nBeothiah chuckled as she watched the \"little ants\" scurry around the frozen lake. Each faction trying to maintain control of the flag and scroll which had been ported into her realm, along wih the lake and the building currently residing there.  \"Little soldiers playing at war\", she thought.  Her plan had worked perfectly to draw in The Skald-King and his heir into her little game.\\n\\n\"Irnskar wants to avoid being King for as long as he can, let\\'s give him a taste of being Emporer\", she snorted,  her laughter fading away.',['title']='Irnskar\\'s Folly  Pt 3',},['Color']=279934,['X']=108212,['Roll']=0,},[5]={['SizeZ']=300,['Id']=1149,['Contrast']=1,['Alpha']=1,['Y']=19480,['EffectType']=5016,['SizeX']=120,['Pitch']=0,['Yaw']=5.590290,['SizeY']=300,['Groups']=0,['Z']=105127.779603,['MetaData']={['message']='Look upon the face of Boethiah and wonder. Raise your arms that \\nBoethiah may look on them and bestow a blessing. Know that battle is a \\nblessing. Know that death is an eventuality. Know that you are dust in \\nthe eyes of Boethiah.',['name']='Boethiah',},['Color']=696968,['X']=108646.190098,['Roll']=0,},[6]={['SizeZ']=1000,['Id']=1150,['Contrast']=1,['Yaw']=5.096361,['Y']=20127,['EffectType']=829,['SizeX']=1000,['Pitch']=3.228859,['SizeY']=1000,['Groups']=0,['Alpha']=1,['Z']=104069.231272,['Color']=997900,['X']=111102.577810,['Roll']=0,},[7]={['SizeZ']=2220,['Id']=1151,['Contrast']=0.140000,['Yaw']=5.201081,['Y']=20157,['EffectType']=4,['SizeX']=980,['Pitch']=1.658063,['SizeY']=2220,['Groups']=0,['Alpha']=0.560000,['Z']=104085.319179,['Color']=998630,['X']=111051.797037,['Roll']=0,},[8]={['SizeZ']=180,['Id']=1152,['Contrast']=1,['Yaw']=0.198968,['Y']=27736,['EffectType']=1011,['SizeX']=300,['Pitch']=0,['SizeY']=180,['Groups']=0,['Alpha']=1,['Z']=96086.457284,['Color']=9