ning this house since I lost all of my Fx.  I made a few minor changes and added a category.',},[62]={['N']='Sil-Var Monastary',['O']=18855,},[23]={['N']='Khargorcian Classic',['O']=18875,['C']=1.026000,['D']='LOCATION! LOCATION! LOCATION!\\nWhat more could a young, upwardly mobile Khajiit/Argonian want. Boasting a 1 bedroom, 2 kitchen (inside and out) living space. Close to shops and fine dining. (You can enter the house if you angle  at the door) Thank you for visiting.',},},['TS']=1631548995,['Key']='oh__@dara_shadowmane',}"
