R["fx__@koverhar"]="{['Houses']={[1]={['World']='eu',['Effects']={[1]={['X']=73548,['Pitch']=0,['Z']=74605,['Color']=997215,['MetaData']={['message']='Death to Esraj',},['SizeZ']=40,['SizeX']=300,['Alpha']=1,['Roll']=0,['Y']=16363,['EffectType']=4406,['Groups']=0,['SizeY']=40,['Contrast']=1,['Id']=1005,['Yaw']=0.841249,},[2]={['X']=73941,['Pitch']=1.570971,['Z']=74383,['Color']=63704,['MetaData']={['title']='The Word',['message']='It cannot be seen, it cannot be felt,\\n\\nCannot be heard, cannot be smelt,\\n\\nLies behind stars and under hills,\\n\\nand empty holes it fills.\\n\\nComes first follows after,\\n\\nEnds life kills laughter.',},['SizeZ']=30,['SizeX']=26.456456,['Alpha']=1,['Roll']=0,['Y']=17555,['EffectType']=8503,['Groups']=0,['SizeY']=30,['Contrast']=1,['Id']=1008,['Yaw']=5.567600,},[3]={['X']=74110,['Pitch']=4.799655,['Z']=74536,['Color']=992819,['MetaData']={['title']='The Location',['message']='You entered the main floor,\\nand did the wheel chore.\\n\\nBut keep your faith low,\\nthe bread is still dough.\\n\\nThe solution you seek,\\nis far down...',},['SizeZ']=30,['SizeX']=26.456456,['Alpha']=1,['Roll']=0,['Y']=17557,['EffectType']=8503,['Groups']=0,['SizeY']=30,['Contrast']=1,['Id']=1009,['Yaw']=5.567600,},[4]={['X']=74329,['Pitch']=4.712564,['Z']=74778,['Color']=150027,['MetaData']={['title']='Kitty\\'s Clue',['message']='You\\'ve seen bel étage,\\nfull of laughter and fun.\\n\\nYou found all the clues,\\nand the wheels have been spun.\\n\\nYou spotted the creature\\nthat hides by the bed.\\n\\nNow tell me, lost soul,\\nwhere will you next head?',},['SizeZ']=30,['SizeX']=26.456456,['Alpha']=1,['Roll']=0,['Y']=17544,['EffectType']=8503,['Groups']=0,['SizeY']=30,['Contrast']=1,['Id']=1010,['Yaw']=5.567600,},[5]={['X']=75262,['Z']=75179,['Pitch']=1.658063,['Alpha']=1,['SizeZ']=44,['SizeX']=45,['Color']=494015,['Roll']=0,['Y']=16882,['EffectType']=881,['Groups']=0,['SizeY']=44,['Contrast']=0.500000,['Id']=1012,['Yaw']=0,},[6]={['X']=73211,['Z']=75679,['Pitch']=0,['Alpha']=1,['SizeZ']=420,['SizeX']=360,['Color']=996531,['Roll']=0,['Y']=16363,['EffectType']=4504,['Groups']=0,['SizeY']=420,['Contrast']=1,['Id']=1015,['Yaw']=2.426008,},[7]={['X']=74172,['Color']=240099,['Z']=74512,['Pitch']=4.799655,['MetaData']={['title']='Rules of the Bad Boys\\' Club',['message']='Rules:\\n1. Koverhar\\'s word is law.\\n2. Girls allowed',},['SizeZ']=30,['SizeX']=26.456456,['Alpha']=1,['SizeY']=30,['Y']=16125,['EffectType']=8501,['Groups']=0,['Roll']=0,['Contrast']=0.010000,['Id']=1016,['Yaw']=5.567600,},},['HouseId']=78,['TS']=1604271137,['Version']='15.7.9',},[2]={['World']='eu',['Effects']={[1]={['X']=23232,['Alpha']=1,['Z']=24292,['Color']=240403,['MetaData']={['title']='The Greed of Koverhar the Coiner',['message']='What happened here?\\n\\nIt all started at the Rimmen Temple. The maze solver were losing their minds over planks and dead ends.\\n\\nThen one day, an new opportunity arose. A new puzzle. But Koverhar could not do it alone. He may be a Coiner but this would be in the millions. He... he needed help.\\n\\nAnd so he turned to the Daedra. He asked for servants to help him for free, and Molag Bal answered. Kitty was granted, but she came at a cost. Before Koverhar knew it, Molag Bal used the portal to summon Kitty and made an anchor into Nirn yet again.\\n\\nAll because Koverhar\\'s greed got the best of him. Now, shamefully, he lost control of Proudspire, and it shall be known forever as... Greedhome.',},['SizeZ']=30,['SizeX']=26.456456,['Pitch']=4.799655,['EffectType']=8503,['Y']=10088,['SizeY']=30,['Groups']=0,['Roll']=0,['Contrast']=1,['Id']=1014,['Yaw']=1.570796,},},['HouseId']=4,['TS']=1611529710,['Version']='16.0.9',},},['TS']=1611529710,['Key']='fx__@koverhar',}"
